$(function(){
	var 
	$page=$("html, body"),
	$body=$("body"),
	$side=$("#side-nav"),
	$footer=$("footer"),
	$grid=$(".grid"),
	$navbar=$(".navbar-fixed-top"),
	$parallax=$("#parallax-window"),
	$navCollapse=$(".navbar-collapse"),
	$form=$("form[role='search']"),
	$client=$(".btn-clipboard"),
	$backToTop=$("#back-to-top"),
	breakHeight=parseFloat($body.css("line-height").slice(0,-2)),
	footerHeight=0;if($navbar.length){$navbar.autoHidingNavbar({hideOffset:400,animationDuration:100})}if($navCollapse.length){$navCollapse.on("shown.bs.collapse",

	function(e){if($("input[type='search']").val()==""){e.preventDefault()}})}if($side.length){$body.scrollspy({target:".scrollspy",offset:90});$body.on("activate.bs.scrollspy",
	function(e){$(".sub").addClass("collapse");$(e.target).find("ul").removeClass("collapse")});
	$footer.each(function(){footerHeight+=$(this).outerHeight()});
	$side.affix({offset:{top:$("main").offset().top,bottom:breakHeight*3+footerHeight}});
	$side.on("click","a",function(e){var top=$($(this).attr("href")).offset().top;
	$page.stop().animate({scrollTop:top-80},"slow");return false})}if($backToTop.length){$backToTop.on("click",function(){var speed=$body.height()/6;
	$page.on("scroll mousedown wheel DOMMouseScroll mousewheel keyup",
	function(){$page.stop()});$page.css("overflow-y","hidden");
	$page.stop().animate({scrollTop:0},speed);$page.css("overflow-y","auto");return false});$(window).scroll(function(){var top=$("#back-to-top");if($(window).scrollTop()>$body.height()/6){top.removeClass("gone");
	top.addClass("visible")}else{top.removeClass("visible");
	top.addClass("gone")}})}if($client.length){new ZeroClipboard($client);
	$client.on("mouseenter mouseleave",function(e){$(this).attr("data-original-title","Copy to clipboard");$(this).tooltip("show")});
	$client.on("click",function(e){$(this).attr("data-original-title","Copied!");$(this).tooltip("show")});
	ZeroClipboard.on("copy",function(e){var target=e.target;var text=$(target).nextAll("pre").text();
	e.clipboardData.setData("text/plain",text)})}if(window.anchors){anchors.add("h1, h3").remove("#plugin-title")}
	if($(".connectedSortable").length){var $tables=$("#Excel");
	$tables.tableExport({formats:["xlsx"]})}});